Under Milk Wood by Dylan Thomas

Arts Documentary hosted by Pip Broughton, published by BBC in 2014 - English narration


Information
------------------------------

A unique one-off television production of Dylan Thomas's famous 'play for voices' performed by a community of Welsh talent in New York, Los Angeles, London, Cardiff and Laugharne. Michael Sheen opens as First Voice, Sir Tom Jones as Captain Cat and as each of Dylan's iconic characters joins in, the piece builds up into a collage of famous voices and faces (including Matthew Rhys, Ioan Gruffudd, SiÃƒÂ¢n Phillips, Jonathan Pryce, Bryn Terfel and Katherine Jenkins) intercut with evocative imagery inspired by the play and created as part of a live event by National Theatre Wales.

